class EventEmitter {
    constructor() {
        this.events = {};
    }

    on(event, listener) {
        if (!this.events[event]) {
            this.events[event] = [];
        }
        this.events[event].push(listener);
    }

    emit(event, ...args) {
        if (this.events[event]) {
            this.events[event].forEach(listener => listener.apply(this, args));
        }
    }
}

class tepianDashboard extends EventEmitter {

    baseUrl = `http://127.0.0.1:8000/api/`;

    constructor() {
        super();
    }
}

